import {
    createBrowserRouter, RouterProvider
} from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
/*
* Eventually will load data from a database
*
* */
import Root from "./routes/Root";
import ExamplePage from "./toy_examples/ExamplePage";
import VizNavigation from "./routes/VizNavigation";
const App = () => {
    const router = createBrowserRouter([
        {
            path: "/",
            fallbackElement: <Root />,
            children: [
                {
                    path: "cat-test",
                    fallbackElement: <ExamplePage />,
                },
            ],
        },
    ]);
    return (
        <>
            <RouterProvider router={router}/>
            </>
    );
};
export default App;
